package com.company.SET_MAP;import java.util.LinkedHashSet;import java.util.Scanner;import java.util.Set;import java.util.TreeSet;public class SoftUniParty_02 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        Set<String> guestList = new TreeSet<>();        String guest = scanner.nextLine();        while (!guest.equals("PARTY")) {            guestList.add(guest);            guest = scanner.nextLine();        }        String comeGuest = scanner.nextLine();        while (!comeGuest.equals("END")){           guestList.remove(comeGuest);            comeGuest = scanner.nextLine();        }        System.out.println(guestList.size());        guestList.forEach( e -> System.out.println(e));    }}